import React from 'react';
import { Typography, Box } from '@mui/material';
import BlogList from '../components/BlogList';

function Blog() {
  return (
    <Box sx={{ width: '100vw', minHeight: '100vh', px: 0, py: 0, bgcolor: '#f8fafc', display: 'flex', justifyContent: 'center', alignItems: 'flex-start' }}>
      <Box sx={{
        width: '100%',
        maxWidth: 1500,
        mx: 'auto',
        mt: 4,
        mb: 4,
        bgcolor: '#fff',
        borderRadius: 4,
        boxShadow: '0 8px 32px 0 rgba(60,72,88,0.12)',
        border: '1px solid #e0e0e0',
        px: { xs: 1, sm: 3, md: 6 },
        py: 4,
      }}>
        <Typography variant="h4" gutterBottom sx={{ mt: 2 }}>Career Blog</Typography>
        <BlogList />
        <Typography variant="body1" color="text.secondary" sx={{ mt: 2 }}>Read the latest career tips and industry news.</Typography>
      </Box>
    </Box>
  );
}

export default Blog;
